Text 
I. ABSCHNITT 
Vorschriften für nichtverbücherte Liegenschaften und für Bauwerke 
§ 1. (1)  In  die  Sammlung der  bei  Gericht   hinterlegten  und  eingereihten   Liegenschafts- und 
Bauwerksurkunden werden aufgenommen 
 1. durch Hinterlegung 
 a) die in den §§ 434 bis 437, 451 und 481 ABGB bezeichneten Urkunden; 
 b) Urkunden über den Erwerb und die Übertragung von Reallasten; 
 c) Urkunden über den Erwerb und die Übertragung von Bestandrechten (§ 1095 ABGB);

b) Urkunden über den Erwerb und die Übertragung von Reallasten; 
 c) Urkunden über den Erwerb und die Übertragung von Bestandrechten (§ 1095 ABGB); 
 d) Urkunden  über  den  Erwerb  von  Wiederkaufsrechten  und  von  Vorkaufsrechten  (§§ 1070  und 
1073 ABGB); 
 e) Urkunden über Belastungs- und Veräußerungsverbote (§ 364c ABGB); 
 2. durch Einreihung 
 a) Abschriften  der  Protokolle  über  die  pfandweise  Beschreibung  nach  den  §§ 90  und  134  EO,

e) Urkunden über Belastungs- und Veräußerungsverbote (§ 364c ABGB); 
 2. durch Einreihung 
 a) Abschriften  der  Protokolle  über  die  pfandweise  Beschreibung  nach  den  §§ 90  und  134  EO, 
Ausfertigungen  des  Beschlusses  über  die  Erteilung  des  Zuschlags  nach  § 183  EO  sowie 
Abschriften   der   Protokolle   über   die   Pfändung   und   den Verkauf   eines   Bauwerks   im 
Exekutionsverfahren;

Abschriften   der   Protokolle   über   die   Pfändung   und   den Verkauf   eines   Bauwerks   im 
Exekutionsverfahren; 
 b) andere  Urkunden  über  den  Erwerb  eines  dinglichen  Rechtes,  sofern  zum  Rechtserwerb  nicht 
die Hinterlegung erforderlich ist; 
 c) Urkunden,  die  das  Erlöschen  eines  durch  Hinterlegung  oder  Einreihung  ausgewiesenen 
Rechtes bewirken oder sein Nichtbestehen feststellen; 
 d) Beschlüsse, mit denen ein Antrag auf Hinterlegung oder Einreihung abgewiesen wird;

Rechtes bewirken oder sein Nichtbestehen feststellen; 
 d) Beschlüsse, mit denen ein Antrag auf Hinterlegung oder Einreihung abgewiesen wird; 
 e) Rekurse  gegen  Beschlüsse,  mit  denen  die  Hinterlegung  oder  die  Einreihung  bewilligt  oder 
abgewiesen worden ist, und Beschlüsse, mit denen über solche Rekurse entschieden wird; 
 f) Urkunden  über  sonstige  Umstände,  sofern  diese  im  Fall  der  Verbücherung  Gegenstand  einer 
Anmerkung, Ersichtlichmachung oder Löschung sein könnten.
